*15 REFLEXÕES PARA OS PRÓXIMOS 7 DIAS:*

1) Mandato do PR termina 31/12/2022;

2) Início das intervenções entre o natal e ou ano novo, com base legal dentro dos artigos da Constituição Federal 136 e 142;

3) "Golpe" para comunidade internacional só se permanecer no poder após 31/12/2022 - senão não há como os comunistas e a imprensa marrom alegarem golpe no Brasil à comunidade internacional;

4) Após iniciada a Intervenção, a prioridade do PR é a segurança dele e de sua família, o qual viajará por um período de no mínimo 30 dias a partir de 31/12/2022 a um País do ocidente que tenha garantida a sua segurança, liberdade e se possível com um governo de direta, como por exemplo a Itália, com a Primeira Ministra Georgia Meloni - ou aos EUA, Estado da Flórida que é atualmente governado por um Governador de direita Republicano. 

5) Não esqueçamos que não é por acaso que a Dep Fed Carla Zambelli  esteve na Itália ontem (22/12/2022) e hoje em reuniões com parlamentares e dirigentes do atual governo italiano de direita, a fim de tratar sobre tais assuntos aqui descritos; 
Ela foi com essa "missão    preparatória" à Espanha e em especial à Itália, ou seja ter apoio do governo Italiano em caso de narrativa internacional de golpe aqui no Brasil;

6) O início: 
será a aplicação direta de Decreto Presidencial no Art. 136 da CF com a instalação do "Estado de Defesa" sendo  descriminado no referido decreto todas as ações iniciais a serem cumpridas pelas FFAA. 
Lembrando que a aplicação do Art. 136, não necessita legalmente de autorização do Congresso Nacional. A sua decretação é prerrogativa direta do Presidente da República;

7) No dia 29/30 ou 31/12/2022, o PR decreta o Art. 142 da CF com  "Intervenção Constitucional", o qual esse Artigo da CF possibilita a criação legal de uma Junta Militar que presidirá o Brasil a partir de 01/01/2023;

8) Bolsonaro a partir de 01/01/2023 sai de cena oficialmente e voluntariamente; e não estará mais atuando como Presidente da República, assim não há como alegarem golpe sem ele estar atuando como Presidente da República do Brasil a partir de 01/01/2023;

9) Essa Junta Militar terá como missão precípua cancelar todas as ameaças e crimes contra a Constituição por meio de prisões, afastamento de funções públicas com a aplicação de inúmeras ações;

10) Também como prioridade da Junta Militar, será a de preparar e gerir de forma direta com brevidade, uma nova eleição presidencial com voto impresso e auditável; promovendo o equilíbrio Constitucional entre os Poderes;

11) Assim o PR Bolsonaro sai de cena em 31/12/2022, permanecendo em segurança no exterior (prevenindo a possibilidade de ataques terroristas contra ele) até que a Junta Militar finalize o saneamento das ações corretivas no País.

12) Retorno do Presidente Bolsonaro ao Brasil ocorrerá somente após a Junta Militar estiver com todas as ações saneadoras finalizadas; qdo então iniciar um novo processo eleitoral para presidência da República.

13) A Junta Militar interventora constitucional presidirá o Brasil nesse período; o quanto tempo for necessário até que as ações saneadoras das FFAA sejam cumpridas e se entender como necessário, nesse período de excessão,  manterá ou não o Congresso e o Senado em funcionamento, incluindo os governadores, senadores deputados federais eleitos; isso até a eclosão de uma nova eleição presidencial, que ocorrerá em até 180 dias devido aos preparativos técnicos de tecnologia da informação necessários para a aplicação de uma nova eleição presidencial com voto impresso e auditável. 

14) A Junta Militar constituída terá o poder de anular todas as decisões do STF; do STJ  e do TSE do últimos meses que atentaram contra às Cláusulas Pétreas da Constituição Federal; 

15) Uma outra possibilidade iminente é o PR não aplicar o Art 136 da CF ("Estado de Defesa") e vir a decretar diretamente o Art. 142 da CF, isso no dia de sua viagem ao exterior, podendo ocorrer tal decretaçao nos dias 29; 30; ou 31/12/2022. De imediato após a decretação do Art. 142 da CF, assume a Presidência do Brasil uma Junta Militar.
